# -------------
# Python请求示例:
# 参数说明：
#  query: 问题
#  image_type: 图片传输类型, base64
#  image_file: 图片内容，内容格式由image_type决定
# -------------

import requests
import json

url = "http://cs-llm-sandbox.intsig.net/varytoy/v1/chat"

payload = json.dumps(
    {
        "query": "ocr all texts",
        "image_type": "base64",
        "image_file": ""
    })
headers = {
    'Content-Type': 'application/json'
}

response = requests.request("POST", url, headers=headers, data=payload)

print(response.text)
